import web from "../src/images/s1.jpg";
import app from "../src/images/s2.jpg";
import android from "../src/images/s3.svg";
import digital from "../src/images/s4.jpg";
import marketing from "../src/images/s5.jpg";
import software from "../src/images/s1.png";

const Sdata = [
    {
        imgsrc:web,
        title:"web development",
        text:"This image is about web development"
    },
    {
        imgsrc:app,
        title:"software development",
        text:"This image is about android development"
    },
    {
        imgsrc:android,
        title:"Digital development",
        text:"This image is about digital development"
    },
    {
        imgsrc: digital,
        title:"Marketing development",
        text:"This image is about marketing development"
    },
    {
        imgsrc: marketing,
        title:"Marketing development",
        text:"This image is about software development"
    }, 
    {
        imgsrc: software,
        title:"Marketing development",
        text:"This image is about software development"
    },   
];
export default Sdata;
